import { Component } from '@angular/core';
import {ubi}

@Component({
  selector: 'app-add-ubicacion',
  templateUrl: './add-ubicacion.component.html',
  styleUrls: ['./add-ubicacion.component.css']
})
export class AddUbicacionComponent {
  ubicacion = {
    nombre: '',
    direccion: '',
    imagen_ubi: '',
    comp_id: null,
    admin_id: null
  };

  constructor(private ubicacionService: UbicacionService) { }

  onSubmit(): void {
    this.ubicacionService.addUbicacion(this.ubicacion).subscribe(response => {
      console.log('Ubicaci√≥n agregada:', response);
    });
  }
}
